import React, { Component } from 'react'

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Join from './components/Join';
import Chat from './components/Chat';
import {SocketUser, socket} from './components/SocketUser';

//Join is login stuff

/*
  <Router>
    <Route path="/" exact component={Join} />
    <Route path="/chat" exact component={Chat} />
    <Route path="/socketuser" exact component={SocketUser} />
  </Router>
*/



class App extends Component{
  constructor(props){
    super(props);
    const socket = this.socket;

  }

  test(){
    socket.emit('FINALLY', {msg: "OMG PLEASE"});
  }


  render(){
    return(
      <Router>
        <Switch>

          <Route path="/">
            <Join socket = {socket}/>
          </Route>

          <Route path="/chat" >
            <Chat socket = {socket}/>
          </Route>

          <Route path="/socketuser" socket = {socket}>
            <SocketUser />
          </Route>

        </Switch>
    </Router>
    )
  }

}



export default App;
